.neon-sign {
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  background-color: black;
}

.neon-letter {
  font-size: 100px;
  color: #00ffff;
  text-shadow:
    0 0 10px #00ffff,
    0 0 20px #00ffff,
    0 0 40px #00ffff,
    0 0 80px #00ffff;
  animation: neon-pulse 1.5s infinite alternate;
}

@keyframes neon-pulse {
  to {
    text-shadow:
      0 0 10px #00ffff,
      0 0 20px #00ffff,
      0 0 40px #00ffff,
      0 0 80px #00ffff,
      0 0 90px #00ffff;
  }
}
```

This code creates a neon sign effect for the word "Open" in a vibrant blue color. Here's how it works:

1. The `.neon-sign` class is a container that centers the letters vertically and horizontally using flexbox.

2. Each letter (O, P, E, N) is wrapped in a `<div>` with the class `neon-letter`.

3. The `font-size` property sets the size of the letters to 100 pixels.

4. The `color` property sets the base color of the letters to a bright blue (#00ffff).

5. The `text-shadow` property creates the neon glow effect. It applies multiple layers of shadows with increasing blur radius to create a glowing effect around the letters.

6. The `animation` property applies the `neon-pulse` keyframe animation to the letters, making them pulse and change slightly in size.

7. The `@keyframes neon-pulse` rule defines the animation. It starts with the initial text-shadow values and then gradually increases the blur radius to create a pulsing effect.

You can adjust the colors, sizes, and animation properties to customize the neon sign according to your preferences.

Here's a simple HTML code using Three.js to create a 3D render of a glass sphere on a wooden table:

```html
<!DOCTYPE html>
<html>
<head>
  <title>Glass Sphere on Wooden Table</title>
  <style>
    body {
      margin: 0;
      overflow: hidden;
    }
  </style>
</head>
<body>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/three.js/r128/three.min.js"></script>
  <script>
    // Set up the scene, camera, and renderer
    const scene = new THREE.Scene();
    const camera = new THREE.PerspectiveCamera(75, window.innerWidth / window.innerHeight, 0.1, 1000);
    const renderer = new THREE.WebGLRenderer();
    renderer.setSize(window.innerWidth, window.innerHeight);
    document.body.appendChild(renderer.domElement);

    // Create the wooden table
    const tableGeometry = new THREE.BoxGeometry(2, 0.1, 2);
    const tableMaterial = new THREE.MeshPhongMaterial({ color: 0x8B4513 });
    const table = new THREE.Mesh(tableGeometry, tableMaterial);
    table.position.y = 0.05;
    scene.add(table);

    // Create the glass sphere
    const sphereGeometry = new THREE.SphereGeometry(0.5, 32, 32);
    const sphereMaterial = new THREE.MeshPhysicalMaterial({
      color: 0xffffff,
      transparent: true,
      opacity: 0.5,
      reflectivity: 0.9,
      roughness: 0.01,
    });
    const sphere = new THREE.Mesh(sphereGeometry, sphereMaterial);
    sphere.position.y = 0.6;
    scene.add(sphere);

    // Add lighting
    const ambientLight = new THREE.AmbientLight(0xffffff, 0.5);
    scene.add(ambientLight);
    const pointLight = new THREE.PointLight(0xffffff, 1);
    pointLight.position.set(2, 2, 2);
    scene.add(pointLight);

    // Set up the camera position
    camera.position.z = 3;

    // Animation loop
    function animate() {
      requestAnimationFrame(animate);
      renderer.render(scene, camera);
    }
    animate();
  </script>
</body>
</html>
```

This code uses Three.js, a popular JavaScript library for creating 3D graphics in the browser. It sets up a scene, camera, and renderer, creates a wooden table using a box geometry and material, and adds a glass sphere using a sphere geometry and a physical material with transparency and reflectivity properties. It also adds ambient and point lighting to the scene.

The glass sphere is positioned on top of the wooden table, and the scene is rendered in an animation loop using `requestAnimationFrame`.

